        {data.map((profile) => (
          <div key={profile.id} style={cardStyle}>
            <img src={profile.profilePic} alt={profile.name} style={imageStyle} />
            <h2>{profile.name}</h2>
            <p>Language: {profile.language}</p>
            <p>Education: {profile.education}</p>
            <p>Specialization: {profile.specialization}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

